그리고 옥수수케이크와  여성들에게 인기있는 체리쵸코케이크 주문.
마롱화이트는 밤 베이스인데  진짜 맛있다.
이건 추천해드린다.
유성정원차도  시그니처인데 이집은  시그니처가 믿고먹을 만큼  괜찮다.
배백차는 약간의 카모마일 맛느낌이라고 생각하면된다.
단 개인적 소견으로 케이크는 세가지 종류중 두가지를 주문했는데 맛은 없다. 
그나마 여성들한테 인기있는 체리케이크가 괜찮다.
개인적 소견으로 주문할려면 체리케이크로 추천한다.
여긴 음료가 좋아 음료 전 메뉴를 하나씩 먹어볼까 한다.
.
